import react from 'react';
import './styles.css';




export const Search = () => {

    return (

        <div className="search-container">
            <div className="search-content">
                   <div className="search-actions">
                       
                            <span className="search-text">Encontre um perfil Gihub</span>     
                        
                        <div>
                            
                            <input placeholder="Usuario Github"/>
                        
                        </div>
                    </div> 
            </div>
        </div>

    );
}
